import React from 'react';
import {Switch, Route} from 'react-router-dom';

import HomePage from './page/homepage/homepage.component';

import './App.css';

const HatsPage = () => {
  return (
    <div>
      <h1> Hats Page</h1>
    </div>
  )
}


function App() {
  return (
    <div>
      <Switch>
      <Route exact path='/' component= {HomePage} />
      <Route exact path='/hats' component= {HatsPage} />
      </Switch>
    </div>
  );
}

export default App;
